import React from 'react'
import styled from 'styled-components'
import Announcement from '../components/Announcement'
import Footer from '../components/Footer'
import Navbar from '../components/Navbar'


const Container = styled.div`
`

const Wrapper = styled.div`
    padding: 25px;
`

const Title = styled.h1`
    font-weight: 200;
    text-align: center;

`    
const Top = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 25px;
`
const TopButton = styled.button`
    padding:10px;
    font-weight: 600;
    cursor: pointer;
    border : ${(props)=> props.type === "filled" && "none"};
    background-color : ${(props)=> props.type === "filled" ? " #1b2d51" : "transparent"};
    color : ${(props)=> props.type === "filled" && "#3dc3b6"};
`
const TopTexts = styled.div``

const TopText = styled.span`
    cursor:pointer;
    margin: 0px 10px;
`

const Bottom = styled.div`
    display: flex;
    justify-content: space-between;
`

const Info = styled.div`
    flex:3

`

const Sum = styled.div`
    flex:1;

`

const ShoppingCart = () => {
    return (
        <Container>
            <Navbar />
            <Announcement />
            <Wrapper>
                <Title>Mandje</Title>
                <Top>
                    <TopButton>Verder met shoppen</TopButton>
                    <TopTexts>
                        <TopText>Shopping cart</TopText>
                        <TopText>Wishlist</TopText>
                    </TopTexts>
                    <TopButton type="filled">Afrekenen</TopButton>
                </Top>
                <Bottom>
                    <Info></Info>
                    <Sum></Sum>
                </Bottom>
            </Wrapper>
            <Footer />
        </Container>
    )

}

export default ShoppingCart
